    "historic-large-fires-for-boise-national-forest-idaho-for-1900-1997",nt"isopen":
    false,nt"url": null,nt"notes": "This data set reflects large fires (approximately
    200 acre minimum size) for 1900-1997 for Boise National Forest, Idaho. Due to multiple
    fires occurring in the same area, at different times, many individual polygons are
    much smaller than 200 acres. Fire location, perimeter, and size are approximate.
    Much variation in accuracy of spatial features, eg. fire perimeters for 1994 (Boise
    River Complex) were collected with aerial gps, while perimeters for much older fires
    were approximated from narrative accounts. Data source/accuracy for individual fires
    not identified. Attributes for some fires included recorded acres as well as ArcInfo
    calcualted acres, much variablility in agreement, see discussion under procedures
    used and limitations of data.",nt"license_title": null,nt"extras": [{ntt"key":
